#!/bin/bash
echo "################ Custom Init Script: Started ################"
yum update -y

# Install Tomcat
amazon-linux-extras enable tomcat9
yum install -y tomcat tomcat-admin-webapps tomcat-webapps jq
systemctl start tomcat
systemctl enable tomcat
systemctl status tomcat --no-pager


# Install Nginx
amazon-linux-extras enable nginx1
yum install -y nginx
systemctl start nginx
systemctl enable nginx
systemctl status nginx --no-pager

# Install Cloudwatch Agent
yum install -y amazon-cloudwatch-agent

echo '
{
    "agent": {
        "debug": true
    },
    "traces": {
        "traces_collected": {
            "application_signals": {}
        }
    },
    "metrics": {
        "namespace": "obh",
        "aggregation_dimensions": [
            [
                "InstanceId"
            ]
        ],
        "append_dimensions": {
            "InstanceId": "${aws:InstanceId}"
        },
        "metrics_collected": {
            "cpu": {
                "measurement": [
                    "cpu_usage_active",
                    "cpu_usage_user",
                    "cpu_usage_system",
                    "cpu_usage_iowait"
                ],
                "metrics_collection_interval": 60
            },
            "disk": {
                "measurement": [
                    "disk_used_percent",
                    "disk_free"
                ],
                "resources": [
                    "*"
                ],
                "metrics_collection_interval": 60
            },
            "net": {
                "measurement": [
                    "bytes_sent",
                    "bytes_recv",
                    "packets_sent",
                    "packets_recv",
                    "err_in",
                    "err_out"
                ],
                "resources": [
                    "*"
                ],
                "metrics_collection_interval": 60
            },
            "swap": {
                "measurement": [
                    "swap_used",
                    "swap_free"
                ]
            },
            "procstat": {
                "measurement": [
                    "proc_total",
                    "proc_running"
                ],
                "metrics_collection_interval": 60
            },
            "mem": {
                "measurement": [
                    "mem_used_percent",
                    "mem_available",
                    "mem_cached"
                ],
                "metrics_collection_interval": 60
            }
        }
    },
    "logs": {
        "metrics_collected": {
            "application_signals": {}
        },
        "logs_collected": {
            "files": {
                "collect_list": [
                    {
                        "file_path": "/var/log/tomcat/localhost_access_log*.txt",
                        "log_group_name": "obh-tomcat-access-logs",
                        "log_stream_name": "{instance_id}-access",
                        "timestamp_format": "%d/%b/%Y:%H:%M:%S %z"
                    },
                    {
                        "file_path": "/var/log/tomcat/catalina*.log",
                        "log_group_name": "obh-tomcat-error-logs",
                        "log_stream_name": "{instance_id}-catalina",
                        "timestamp_format": "%Y-%m-%d %H:%M:%S,%f"
                    },
                    {
                        "file_path": "/var/log/nginx/access.log",
                        "log_group_name": "obh-nginx-access-logs",
                        "log_stream_name": "{instance_id}-nginx-access",
                        "timestamp_format": "%d/%b/%Y:%H:%M:%S %z"
                    },
                    {
                        "file_path": "/var/log/nginx/error.log",
                        "log_group_name": "obh-nginx-error-logs",
                        "log_stream_name": "{instance_id}-nginx-error",
                        "timestamp_format": "%Y/%m/%d %H:%M:%S"
                    }
                ]
            }
        }
    }
}
' > /opt/aws/amazon-cloudwatch-agent/etc/amazon-cloudwatch-agent.json

systemctl start amazon-cloudwatch-agent
systemctl enable amazon-cloudwatch-agent
systemctl status amazon-cloudwatch-agent --no-pager

# Install X-Ray Daemon
# curl https://s3.us-east-2.amazonaws.com/aws-xray-assets.us-east-2/xray-daemon/aws-xray-daemon-3.x.rpm -o /home/ec2-user/xray.rpm
# yum install -y /home/ec2-user/xray.rpm
# systemctl enable xray.service
# systemctl start xray.service
# systemctl status xray.service --no-pager

# Install Python 3.8
yum install -y python3-pip python3-dev python3-venv 
yum remove python3 
amazon-linux-extras install python3.8
rpm -ql python38
ln -sf /usr/bin/python3.8 /usr/bin/python3
ln -sf /usr/bin/pydoc3.8 /usr/bin/pydoc
python3 --version

# Run ADOT Collector
cd ~
wget -nv https://aws-otel-collector.s3.amazonaws.com/amazon_linux/amd64/latest/aws-otel-collector.rpm
rpm -Uvh  ./aws-otel-collector.rpm
/opt/aws/aws-otel-collector/bin/aws-otel-collector-ctl -a start
systemctl status aws-otel-collector 


# Install MySQL
amazon-linux-extras install epel -y
yum install -y https://dev.mysql.com/get/mysql80-community-release-el7-5.noarch.rpm
rpm --import https://repo.mysql.com/RPM-GPG-KEY-mysql-2023
yum install -y mysql-community-server 
systemctl enable mysqld 
systemctl start mysqld 
systemctl status mysqld --no-pager
temp_password=$(sudo grep 'temporary password' /var/log/mysqld.log | awk '{print $NF}')
new_password=A+a8th+++ms
mysql --connect-expired-password -u root -p$temp_password  -e "ALTER USER 'root'@'localhost' IDENTIFIED BY '$new_password';"
mysql -u root -p$new_password -e "CREATE DATABASE test;"
mysql -u root -p$new_password -e "SHOW DATABASES;"


# Download App
cd ~
APPS=("nexusapp" "nobleapp")
NAMESPACE=obh
REGION=us-east-1

# Update the default page
cat <<EOF > /usr/share/nginx/html/index.html
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Applications</title>
</head>
<body>
    <h1>Links</h1>
EOF
for app in "${APPS[@]}"; do
    echo "<a id=\"$app\" href=\"/$app\">$app</a><br>" >> /usr/share/nginx/html/index.html
done
cat <<EOF >> /usr/share/nginx/html/index.html
</body>
</html>
EOF

cat <<EOF > /etc/nginx/conf.d/$NAMESPACE.conf
server {
    listen 80;
    server_name $NAMESPACE.com;  
}
EOF

# Download all apps
aws s3 cp --recursive s3://
